  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Audubon National
  Wildlife Refuge, Lake Nettie Refuge, McLean Refuge, Hiddenwood Refuge, Lake Otis
  Refuge, Strawberry Lake Refuge, Sheyenne Lake Refuge, and Lost Lake Refuge outlines
  Refuge accomplishments during the 1978 calendar year. The report begins with an
  introduction to the Refuge and information about weather conditions, habitat conditions,
  land acquisition activities, and the system status. Construction and maintenance
  are also described. Habitat management is covered; croplands, grasslands, wetlands,
  and forests are discussed. The wildlife section of the report discusses endangered
  and threatened species, migratory birds, mammals, and non-migratory birds. Interpretation
  and recreation activities are outlined; topics include information and interpretation
  and law enforcement. Field investigations and items of interest are attached.\",\n\t\"license_title\":
